import React, { useState, useEffect } from 'react';
import { 
  Search, 
  Filter, 
  Plus, 
  MapPin, 
  Phone, 
  Mail, 
  Car, 
  DollarSign, 
  TrendingUp, 
  Star, 
  Clock, 
  Users, 
  Settings, 
  ArrowLeft, 
  ArrowRight, 
  MoreVertical, 
  Edit3, 
  Eye, 
  Trash2, 
  FileText, 
  Activity, 
  Calendar,
  Shield,
  BarChart3,
  CheckCircle,
  AlertCircle,
  UserPlus
} from 'lucide-react';
import { useNavigate } from 'react-router-dom';

const DealerNetworkPage = () => {
  const navigate = useNavigate();
  const [currentUser] = useState({
    name: 'Chris Murphy',
    email: 'chris@rpexotics.com',
    role: 'admin',
    avatar: null
  });

  const permissions = {
    admin: {
      canCreateDeals: true,
      canViewDeals: true,
      canEditDeals: true,
      canSearchDealers: true,
      canManageDealers: true,
      canAccessBackOffice: true,
      canViewReports: true,
      canViewFinancials: true,
      canManageUsers: true
    },
    sales: {
      canCreateDeals: true,
      canViewDeals: true,
      canEditDeals: true,
      canSearchDealers: true,
      canManageDealers: true,
      canAccessBackOffice: false,
      canViewReports: true,
      canViewFinancials: false,
      canManageUsers: false
    },
    finance: {
      canCreateDeals: false,
      canViewDeals: true,
      canEditDeals: true,
      canSearchDealers: true,
      canManageDealers: false,
      canAccessBackOffice: true,
      canViewReports: true,
      canViewFinancials: true,
      canManageUsers: false
    },
    viewer: {
      canCreateDeals: false,
      canViewDeals: true,
      canEditDeals: false,
      canSearchDealers: true,
      canManageDealers: false,
      canAccessBackOffice: false,
      canViewReports: true,
      canViewFinancials: false,
      canManageUsers: false
    }
  };

  const userPermissions = permissions[currentUser.role];

  const [dealers, setDealers] = useState([]);
  const [loading, setLoading] = useState(true);
  const [searchQuery, setSearchQuery] = useState('');
  const [selectedFilters, setSelectedFilters] = useState({
    region: 'all',
    dealerType: 'all',
    status: 'all',
    rating: 'all'
  });
  const [viewMode, setViewMode] = useState('grid'); // 'grid' or 'list'
  const [showAddDealer, setShowAddDealer] = useState(false);
  const [selectedDealer, setSelectedDealer] = useState(null);
  const [editDealer, setEditDealer] = useState(null);

  // Load dealers from MongoDB
  useEffect(() => {
    const loadDealers = async () => {
      setLoading(true);
      try {
        const response = await fetch('/api/dealers');
        const data = await response.json();
        setDealers(data.data || data.dealers || []);
        setLoading(false);
      } catch (error) {
        console.error('Error loading dealers:', error);
        setLoading(false);
      }
    };
    loadDealers();
  }, []);

  const handleAddDealer = async (dealerData) => {
    try {
      const response = await fetch('/api/dealers', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify(dealerData),
      });
      const newDealer = await response.json();
      setDealers(prev => [...prev, newDealer]);
      setShowAddDealer(false);
    } catch (error) {
      console.error('Error adding dealer:', error);
    }
  };

  const handleEditDealer = async (dealerId, dealerData) => {
    try {
      const response = await fetch(`/api/dealers/${dealerId}`, {
        method: 'PUT',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify(dealerData),
      });
      const updatedDealer = await response.json();
      setDealers(prev => prev.map(d => d.id === dealerId ? updatedDealer : d));
      setEditDealer(null);
    } catch (error) {
      console.error('Error updating dealer:', error);
    }
  };

  const filteredDealers = dealers.filter(dealer => {
    const matchesSearch = dealer.name.toLowerCase().includes(searchQuery.toLowerCase()) ||
                         dealer.company?.toLowerCase().includes(searchQuery.toLowerCase()) ||
                         dealer.contact?.person?.toLowerCase().includes(searchQuery.toLowerCase());

    const matchesRegion = selectedFilters.region === 'all' || dealer.location?.includes(selectedFilters.region);
    const matchesType = selectedFilters.dealerType === 'all' || dealer.type === selectedFilters.dealerType;
    const matchesStatus = selectedFilters.status === 'all' || dealer.status === selectedFilters.status;
    const matchesRating = selectedFilters.rating === 'all' || dealer.rating >= parseInt(selectedFilters.rating);

    return matchesSearch && matchesRegion && matchesType && matchesStatus && matchesRating;
  });

  const getStatusColor = (status) => {
    switch(status) {
      case 'Active': return 'bg-green-500/20 text-green-400';
      case 'Inactive': return 'bg-red-500/20 text-red-400';
      case 'Pending': return 'bg-yellow-500/20 text-yellow-400';
      default: return 'bg-gray-500/20 text-gray-400';
    }
  };

  const getRatingStars = (rating) => {
    return Array.from({ length: 5 }, (_, i) => (
      <Star key={i} className={`h-4 w-4 ${i < rating ? 'text-yellow-400 fill-current' : 'text-gray-400'}`} />
    ));
  };

  if (loading) {
    return (
      <div className="min-h-screen bg-gradient-to-br from-gray-900 via-gray-800 to-black flex items-center justify-center">
        <div className="text-center">
          <div className="animate-spin rounded-full h-12 w-12 border-b-2 border-blue-500 mx-auto mb-4"></div>
          <p className="text-white text-lg">Loading dealer network...</p>
        </div>
      </div>
    );
  }

  return (
    <div className="min-h-screen bg-gradient-to-br from-gray-900 via-gray-800 to-black">
      {/* Header */}
      <header className="bg-black/20 backdrop-blur-md border-b border-white/10">
        <div className="max-w-7xl mx-auto px-6 py-4">
          <div className="flex items-center justify-between">
            <div className="flex items-center">
              <button 
                onClick={() => navigate('/')}
                className="mr-4 p-2 rounded-lg bg-white/10 hover:bg-white/20 transition-colors"
              >
                <ArrowLeft className="h-5 w-5 text-white" />
              </button>
              <div>
                <h1 className="text-2xl font-bold text-white">Dealer Network</h1>
                <p className="text-gray-300 text-sm">Manage your dealer contacts and relationships</p>
              </div>
            </div>
            <div className="flex items-center space-x-4">
              <div className="text-right">
                <p className="text-sm font-medium text-white">{currentUser.name}</p>
                <p className="text-gray-400 text-xs">{currentUser.role}</p>
              </div>
              {userPermissions.canManageDealers && (
                <button
                  onClick={() => setShowAddDealer(true)}
                  className="bg-blue-600 hover:bg-blue-700 text-white px-4 py-2 rounded-lg flex items-center space-x-2 transition-colors"
                >
                  <Plus className="h-4 w-4" />
                  <span>Add Dealer</span>
                </button>
              )}
            </div>
          </div>
        </div>
      </header>

      <div className="max-w-7xl mx-auto px-6 py-8">
        {/* Search and Filters */}
        <div className="mb-8">
          <div className="flex flex-col lg:flex-row gap-4">
            {/* Search */}
            <div className="flex-1">
              <div className="relative">
                <Search className="absolute left-3 top-1/2 transform -translate-y-1/2 h-5 w-5 text-gray-400" />
                <input
                  type="text"
                  placeholder="Search dealers by name, company, or contact..."
                  value={searchQuery}
                  onChange={(e) => setSearchQuery(e.target.value)}
                  className="w-full pl-10 pr-4 py-3 bg-white/10 border border-white/20 rounded-lg text-white placeholder-gray-400 focus:outline-none focus:ring-2 focus:ring-blue-500 focus:border-transparent"
                />
              </div>
            </div>

            {/* Filters */}
            <div className="flex gap-4">
              <select
                value={selectedFilters.region}
                onChange={(e) => setSelectedFilters(prev => ({ ...prev, region: e.target.value }))}
                className="px-4 py-3 bg-white/10 border border-white/20 rounded-lg text-white focus:outline-none focus:ring-2 focus:ring-blue-500"
              >
                <option value="all">All Regions</option>
                <option value="North">North</option>
                <option value="South">South</option>
                <option value="East">East</option>
                <option value="West">West</option>
              </select>

              <select
                value={selectedFilters.status}
                onChange={(e) => setSelectedFilters(prev => ({ ...prev, status: e.target.value }))}
                className="px-4 py-3 bg-white/10 border border-white/20 rounded-lg text-white focus:outline-none focus:ring-2 focus:ring-blue-500"
              >
                <option value="all">All Status</option>
                <option value="Active">Active</option>
                <option value="Inactive">Inactive</option>
                <option value="Pending">Pending</option>
              </select>

              <select
                value={selectedFilters.rating}
                onChange={(e) => setSelectedFilters(prev => ({ ...prev, rating: e.target.value }))}
                className="px-4 py-3 bg-white/10 border border-white/20 rounded-lg text-white focus:outline-none focus:ring-2 focus:ring-blue-500"
              >
                <option value="all">All Ratings</option>
                <option value="5">5 Stars</option>
                <option value="4">4+ Stars</option>
                <option value="3">3+ Stars</option>
              </select>
            </div>
          </div>
        </div>

        {/* View Mode Toggle */}
        <div className="flex items-center justify-between mb-6">
          <div className="flex items-center space-x-2">
            <span className="text-white text-sm">View:</span>
            <button
              onClick={() => setViewMode('grid')}
              className={`px-3 py-1 rounded-lg text-sm font-medium transition-colors ${
                viewMode === 'grid' 
                  ? 'bg-blue-600 text-white' 
                  : 'bg-white/10 text-gray-300 hover:bg-white/20'
              }`}
            >
              Grid
            </button>
            <button
              onClick={() => setViewMode('list')}
              className={`px-3 py-1 rounded-lg text-sm font-medium transition-colors ${
                viewMode === 'list' 
                  ? 'bg-blue-600 text-white' 
                  : 'bg-white/10 text-gray-300 hover:bg-white/20'
              }`}
            >
              List
            </button>
          </div>
          <div className="text-gray-400 text-sm">
            {filteredDealers.length} of {dealers.length} dealers
          </div>
        </div>

        {/* Dealers Grid/List */}
        {viewMode === 'grid' ? (
          <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 xl:grid-cols-4 gap-6">
            {filteredDealers.map((dealer) => (
              <div key={dealer.id} className="bg-white/5 backdrop-blur-lg rounded-xl border border-white/10 p-6 hover:bg-white/10 hover:border-white/20 transition-all duration-300">
                <div className="flex items-start justify-between mb-4">
                  <div className="flex-1">
                    <h3 className="text-lg font-bold text-white mb-1">{dealer.name}</h3>
                    <p className="text-gray-400 text-sm">{dealer.company}</p>
                  </div>
                  <div className="flex items-center space-x-2">
                    <span className={`text-xs font-medium px-2 py-1 rounded-full ${getStatusColor(dealer.status)}`}>
                      {dealer.status}
                    </span>
                    {userPermissions.canManageDealers && (
                      <div className="relative">
                        <button className="p-1 hover:bg-white/10 rounded">
                          <MoreVertical className="h-4 w-4 text-gray-400" />
                        </button>
                      </div>
                    )}
                  </div>
                </div>

                <div className="space-y-3 mb-4">
                  {dealer.contact?.person && (
                    <div className="flex items-center text-gray-300 text-sm">
                      <Users className="h-4 w-4 mr-2 text-gray-400" />
                      {dealer.contact.person}
                    </div>
                  )}
                  {dealer.contact?.phone && (
                    <div className="flex items-center text-gray-300 text-sm">
                      <Phone className="h-4 w-4 mr-2 text-gray-400" />
                      {dealer.contact.phone}
                    </div>
                  )}
                  {dealer.contact?.email && (
                    <div className="flex items-center text-gray-300 text-sm">
                      <Mail className="h-4 w-4 mr-2 text-gray-400" />
                      {dealer.contact.email}
                    </div>
                  )}
                </div>

                <div className="flex items-center justify-between mb-4">
                  <div className="flex items-center">
                    {getRatingStars(dealer.rating || 0)}
                    <span className="text-gray-400 text-xs ml-2">({dealer.rating || 0})</span>
                  </div>
                  <div className="text-right">
                    <p className="text-white font-semibold">{dealer.totalDeals || 0} deals</p>
                    <p className="text-gray-400 text-xs">${(dealer.totalVolume || 0).toLocaleString()}</p>
                  </div>
                </div>

                <div className="flex space-x-2">
                  <button className="flex-1 bg-blue-500/20 text-blue-400 hover:bg-blue-500/30 text-sm font-medium py-2 px-3 rounded-lg transition-colors">
                    View Details
                  </button>
                  {userPermissions.canManageDealers && (
                    <button 
                      onClick={() => setEditDealer(dealer)}
                      className="bg-green-500/20 text-green-400 hover:bg-green-500/30 text-sm font-medium py-2 px-3 rounded-lg transition-colors"
                    >
                      Edit
                    </button>
                  )}
                </div>
              </div>
            ))}
          </div>
        ) : (
          <div className="space-y-4">
            {filteredDealers.map((dealer) => (
              <div key={dealer.id} className="bg-white/5 backdrop-blur-lg rounded-xl border border-white/10 p-6 hover:bg-white/10 hover:border-white/20 transition-all duration-300">
                <div className="flex items-center justify-between">
                  <div className="flex items-center space-x-6">
                    <div className="flex-1">
                      <h3 className="text-lg font-bold text-white mb-1">{dealer.name}</h3>
                      <p className="text-gray-400 text-sm">{dealer.company}</p>
                    </div>
                    <div className="flex items-center space-x-4 text-sm">
                      {dealer.contact?.person && (
                        <div className="flex items-center text-gray-300">
                          <Users className="h-4 w-4 mr-2 text-gray-400" />
                          {dealer.contact.person}
                        </div>
                      )}
                      {dealer.contact?.phone && (
                        <div className="flex items-center text-gray-300">
                          <Phone className="h-4 w-4 mr-2 text-gray-400" />
                          {dealer.contact.phone}
                        </div>
                      )}
                      {dealer.contact?.email && (
                        <div className="flex items-center text-gray-300">
                          <Mail className="h-4 w-4 mr-2 text-gray-400" />
                          {dealer.contact.email}
                        </div>
                      )}
                    </div>
                    <div className="text-right">
                      <p className="text-white font-semibold">{dealer.totalDeals || 0} deals</p>
                      <p className="text-gray-400 text-xs">${(dealer.totalVolume || 0).toLocaleString()}</p>
                    </div>
                  </div>
                  <div className="flex items-center space-x-2">
                    <span className={`text-xs font-medium px-2 py-1 rounded-full ${getStatusColor(dealer.status)}`}>
                      {dealer.status}
                    </span>
                    <div className="flex items-center">
                      {getRatingStars(dealer.rating || 0)}
                    </div>
                    {userPermissions.canManageDealers && (
                      <button 
                        onClick={() => setEditDealer(dealer)}
                        className="bg-green-500/20 text-green-400 hover:bg-green-500/30 text-sm font-medium py-2 px-3 rounded-lg transition-colors"
                      >
                        Edit
                      </button>
                    )}
                  </div>
                </div>
              </div>
            ))}
          </div>
        )}

        {/* Empty State */}
        {filteredDealers.length === 0 && (
          <div className="text-center py-12">
            <Users className="h-16 w-16 text-gray-400 mx-auto mb-4" />
            <h3 className="text-xl font-bold text-white mb-2">No dealers found</h3>
            <p className="text-gray-400 mb-6">Try adjusting your search or filters</p>
            {userPermissions.canManageDealers && (
              <button
                onClick={() => setShowAddDealer(true)}
                className="bg-blue-600 hover:bg-blue-700 text-white px-6 py-3 rounded-lg flex items-center space-x-2 mx-auto transition-colors"
              >
                <Plus className="h-4 w-4" />
                <span>Add Your First Dealer</span>
              </button>
            )}
          </div>
        )}
      </div>

      {/* Add/Edit Dealer Modal would go here */}
      {/* For now, we'll just show a placeholder */}
      {showAddDealer && (
        <div className="fixed inset-0 bg-black/50 backdrop-blur-sm flex items-center justify-center z-50">
          <div className="bg-gray-800 rounded-xl p-6 w-full max-w-md">
            <h3 className="text-xl font-bold text-white mb-4">Add New Dealer</h3>
            <p className="text-gray-400 mb-4">Dealer management modal coming soon...</p>
            <button
              onClick={() => setShowAddDealer(false)}
              className="bg-blue-600 hover:bg-blue-700 text-white px-4 py-2 rounded-lg transition-colors"
            >
              Close
            </button>
          </div>
        </div>
      )}

      {editDealer && (
        <div className="fixed inset-0 bg-black/50 backdrop-blur-sm flex items-center justify-center z-50">
          <div className="bg-gray-800 rounded-xl p-6 w-full max-w-md">
            <h3 className="text-xl font-bold text-white mb-4">Edit Dealer</h3>
            <p className="text-gray-400 mb-4">Editing {editDealer.name}...</p>
            <button
              onClick={() => setEditDealer(null)}
              className="bg-blue-600 hover:bg-blue-700 text-white px-4 py-2 rounded-lg transition-colors"
            >
              Close
            </button>
          </div>
        </div>
      )}
    </div>
  );
};

export default DealerNetworkPage;
